<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            background: black;
        }

        body {
            background: black;
        }

        #canvas1 {
            border: 2px solid white;
            /* top: 50%; */
            left: 50%;
            position: absolute;
            width: 785px;
            height: 1000px;
            transform: translate(-50%, 0%);
        }

        @keyframes text_shadow {
            0% {
                text-shadow: 10px 20px rgb(0, 0, 0);
            }

            10% {
                text-shadow: -11px 19px rgb(255, 255, 255);
            }

            20% {
                text-shadow: 12px 18px rgb(0, 217, 124);
            }

            30% {
                text-shadow: -13px -17px rgb(31, 186, 155);
            }

            40% {
                text-shadow: 14px 16px rgb(62, 155, 186);
            }

            50% {
                text-shadow: -15px 15px rgb(93, 124, 217);
            }

            60% {
                text-shadow: 16px 14px rgb(124, 93, 0);
            }

            70% {
                text-shadow: -17px -13px rgb(155, 62, 31);
            }

            80% {
                text-shadow: 18px 12px rgb(186, 31, 62);
            }

            90% {
                text-shadow: -19px 11px rgb(217, 0, 93);
            }

            100% {
                text-shadow: 20px 10px rgb(0, 0, 0);
            }
        }

        @keyframes rainbow {
            0% {
                background-color: black;
                color: white;
                font-size: 100px;
                text-align: center;
            }

            10% {
                background-color: red;
                color: orange;
                font-size: 110px;
                text-align: left;
            }

            20% {
                background-color: orange;
                color: yellow;
                font-size: 120px;
                text-align: center;
            }

            30% {
                background-color: yellow;
                color: green;
                font-size: 130px;
                text-align: right;
            }

            40% {
                background-color: green;
                color: blue;
                font-size: 140px;
                text-align: center;
            }

            50% {
                background-color: blue;
                color: aqua;
                font-size: 150px;
                text-align: right;
            }

            60% {
                background-color: aqua;
                color: purple;
                font-size: 140px;
                text-align: center;
            }

            70% {
                background-color: purple;
                color: black;
                font-size: 130px;
                text-align: left;
            }

            80% {
                background-color: black;
                color: gray;
                font-size: 120px;
                text-align: center;
            }

            90% {
                background-color: gray;
                color: black;
                font-size: 110px;
                text-align: right;
            }

            100% {
                background-color: black;
                color: white;
                font-size: 100px;
                text-align: center;
            }
        }

        @keyframes reverse_rainbow {
            100% {
                background-color: black;
                color: white;
                font-size: 150px;
                text-align: center;
            }

            90% {
                background-color: red;
                color: orange;
                font-size: 140px;
                text-align: left;
            }

            80% {
                background-color: orange;
                color: yellow;
                font-size: 130px;
                text-align: center;
            }

            70% {
                background-color: yellow;
                color: green;
                font-size: 120px;
                text-align: right;
            }

            60% {
                background-color: green;
                color: blue;
                font-size: 110px;
                text-align: center;
            }

            50% {
                background-color: blue;
                color: aqua;
                font-size: 100px;
                text-align: right;
            }

            40% {
                background-color: aqua;
                color: purple;
                font-size: 110px;
                text-align: center;
            }

            30% {
                background-color: purple;
                color: black;
                font-size: 120px;
                text-align: left;
            }

            20% {
                background-color: black;
                color: gray;
                font-size: 130px;
                text-align: center;
            }

            10% {
                background-color: gray;
                color: black;
                font-size: 140px;
                text-align: right;
            }

            0% {
                background-color: black;
                color: white;
                font-size: 150px;
                text-align: center;
            }
        }

        h1 {
            background-color: powderblue;
            color: aqua;
            position: center;
            text-align: center;
            font-family: fantasy;
            animation: rainbow 3s infinite, text_shadow 2.5s infinite;
        }

        h2 {
            background-color: powderblue;
            color: aqua;
            position: center;
            text-align: center;
            font-family: fantasy;
            animation: reverse_rainbow 3s infinite, text_shadow 2.5s infinite;
        }

        p.intro {
            font-family: Roboto;
            font-style: normal;
            font-weight: 500;
            font-size: 30px;
            line-height: 35px;
            text-align: center;
            color: #1E6D8D;
        }

        p.content {
            font-family: Roboto;
            font-style: normal;
            font-weight: normal;
            font-size: 22px;
            line-height: 26px;
            text-align: center;

            color: #434343;
        }

        #ei72_606_10_77 {
            background-color: rgba(67.00000360608101, 67.00000360608101, 67.00000360608101, 1);
            opacity: 1;
            width: 1360px;
            height: 30px;
        }

        #covid_position {
            position: absolute;
            width: 1360px;
            height: 30px;
            left: calc(50% - 1360px/2);
            top: 0px;
        }

        #covid_text {
            position: absolute;
            left: 36.69%;
            right: 36.69%;
            top: 10%;
            bottom: 13.33%;
            font-family: Roboto;
            font-style: normal;
            font-weight: normal;
            font-size: 18px;
            line-height: 21px;
            text-align: center;
            color: #FFFFFF;
        }
    </style>
</head>

                    // set a transparency to every thing that gonna draw
                    ctx.globalAlpha = particlesArray[i].speed * 0.5;
                    // draw the particle to the canvas
                    particlesArray[i].draw();
                }
                // https://developer.mozilla.org/en-US/docs/Web/API/window/requestAnimationFrame
                // http://www.javascriptkit.com/javatutors/requestanimationframe.shtml
                // we call this function the draw the next frame when " the screen is ready to accept the next screen repaint"
                // this recursive make sure the animation keeps going on. 
                requestAnimationFrame(animate);
            }
            // start the animation 
            animate();

            // calculateRelativeBrightness function calculate the relative brightness of a color in a more realistic way. 
            function calculateRelativeBrightness(red, green, blue) {
                return Math.sqrt(
                    (red * red) * 0.299 +
                    (green * green) * 0.587 +
                    (blue * blue) * 0.114
                ) / 100;
            }
        })
    </script>
</body>
